/* Procedure structure for procedure `insert_big_data` */

/*!50003 DROP PROCEDURE IF EXISTS  `insert_big_data` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_big_data`(IN START INT(10), IN max_num INT(10))
BEGIN
DECLARE i INT DEFAULT 0;
SET autocommit=0;
REPEAT
SET i=i+1;
INSERT INTO customer 
VALUES((START+i), CONCAT('tony',i),RAND()*90,'传智播客大数据量记录测试');
UNTIL i = max_num
END REPEAT;
COMMIT;
    END */$$
DELIMITER ;

